import React, { Component } from 'react'

class Counter extends Component {
    constructor(props) {
        super(props)

        this.state = {
             count: 0
        }
    }

    render() {
        return (
            <div>
                <div>The Count is {this.state.count}</div>
                <button onClick={()=>this.increment()}>Increment</button>
            </div>

        )
    }
}

export default Counter
